// src/pages/Projects.jsx
import PageWrapper from "../components/PageWrapper";
import { motion, useInView } from "framer-motion";
import { useRef } from "react";
import { ExternalLink, MoreHorizontal } from "lucide-react";

const container = {
  hidden: { opacity: 1 },
  visible: {
    opacity: 1,
    transition: { delayChildren: 0.2, staggerChildren: 0.12 },
  },
};

const cardPop = {
  hidden: { opacity: 0, y: 30, scale: 0.98 },
  visible: {
    opacity: 1,
    y: 0,
    scale: 1,
    transition: { type: "spring", stiffness: 120, damping: 18 },
  },
};

const projects = [
  {
    title: "Barbershop Booking System",
    status: "In Progress",
    stack: "HTML, Tailwind CSS, JavaScript, React, Next.js",
    desc: "A modern platform for a barbershop with online booking, services, staff schedules, and smooth UX. Includes pricing, contact, and customer support sections.",
    image:
      "https://cdn.jsdelivr.net/gh/tandpfun/skill-icons/icons/TailwindCSS-Light.svg",
    link: "https://github.com/yourusername/barbershop-booking",
  },
  {
    title: "Tiam Alborz Company",
    status: "In Progress",
    stack: "HTML, Tailwind CSS, JavaScript, React, Next.js",
    desc: "Corporate website for a UPS company with clean design, product specs, navigation, company info, and contact details.",
    image:
      "https://cdn.jsdelivr.net/gh/tandpfun/skill-icons/icons/React-Light.svg",
    link: "https://github.com/yourusername/tiam-alborz",
  },
  {
    title: "Portfolio Website",
    status: "Completed",
    stack: "HTML, CSS, JavaScript, React",
    desc: "Personal portfolio with clean navigation, sections for bio, projects, blog, and contact. Fully responsive and fast.",
    image: "https://cdn.jsdelivr.net/gh/tandpfun/skill-icons/icons/HTML.svg",
    link: "https://github.com/yourusername/portfolio",
  },
  {
    title: "Weather App",
    status: "Completed",
    stack: "HTML, CSS, JavaScript, React, Redux Toolkit",
    desc: "A sleek weather app with current conditions, hourly and long-term forecasts, built with a user-friendly interface.",
    image:
      "https://cdn.jsdelivr.net/gh/tandpfun/skill-icons/icons/JavaScript.svg",
    link: "https://github.com/yourusername/weather-app",
  },
  {
    title: "Todo App",
    status: "In Progress",
    stack: "HTML, Tailwind CSS, Next.js, NextAuth.js, MongoDB, API Routes",
    desc: "Simple daily tasks app with Next.js and MongoDB Atlas. Reliable persistence, intuitive interface, and auth.",
    image:
      "https://cdn.jsdelivr.net/gh/tandpfun/skill-icons/icons/NextJS-Light.svg",
    link: "https://github.com/yourusername/todo-app",
  },
  {
    title: "Blog",
    status: "Completed",
    stack: "HTML, Material-UI, JavaScript, React, Redux Toolkit, GraphQL",
    desc: "Dynamic blog with GraphQL backend, fast content fetching, real-time updates, and a scalable API.",
    image:
      "https://cdn.jsdelivr.net/gh/tandpfun/skill-icons/icons/GraphQL-Light.svg",
    link: "https://github.com/yourusername/blog",
  },
];

export default function Projects() {
  return (
    <PageWrapper>
      <section className="min-h-[92vh] w-full bg-[#0f0f11] text-white relative pb-24 md:pb-28">
        <div className="mx-auto max-w-6xl px-4 pt-10 md:pt-12">
          <h1 className="text-center text-2xl md:text-3xl font-extrabold tracking-wide mb-6 md:mb-8">
            ALL PROJECTS
          </h1>

          <motion.div
            className="grid grid-cols-1 md:grid-cols-2 gap-4 md:gap-5"
            variants={container}
            initial="hidden"
            animate="visible"
          >
            {projects.map((p, i) => (
              <ProjectCard key={p.title + i} project={p} />
            ))}
          </motion.div>
        </div>
      </section>
    </PageWrapper>
  );
}

function ProjectCard({ project }) {
  const cardRef = useRef(null);
  const inView = useInView(cardRef, {
    once: true,
    margin: "0px 0px -60px 0px",
  });

  return (
    <motion.article
      ref={cardRef}
      variants={cardPop}
      initial="hidden"
      animate={inView ? "visible" : "hidden"}
      whileHover={{ y: -2 }}
      className="relative rounded-2xl bg-[#17181b] shadow-lg p-6 overflow-hidden"
    >
      {/* Round preview badge */}
      <div className="flex items-center gap-4">
        <div className="h-28 w-28 md:h-32 md:w-32 rounded-full bg-black/30 shadow-inner grid place-content-center overflow-hidden">
          {project.image ? (
            <img
              src={project.image}
              alt={project.title}
              className="h-14 w-14 md:h-16 md:w-16 object-contain opacity-90"
              loading="lazy"
            />
          ) : (
            <div className="text-white/50 text-sm">Preview</div>
          )}
        </div>
      </div>

      {/* Meta rows */}
      <div className="mt-5 text-[13px] leading-5">
        <div>
          <span className="text-white/60">Status:</span>{" "}
          <span className="text-white/90">{project.status}</span>
        </div>
        <div className="mt-1">
          <span className="text-white/60">Created With:</span>{" "}
          <span className="text-white/90">{project.stack}</span>
        </div>
      </div>

      {/* Title */}
      <h3 className="mt-4 text-lg md:text-xl font-semibold">{project.title}</h3>

      {/* Description */}
      <p className="mt-2 text-sm md:text-[15px] text-white/70">
        {project.desc}
      </p>

      {/* Actions (bottom-right) */}
      <div className="absolute right-3 bottom-3 flex items-center gap-2">
        <a
          href={project.link}
          target="_blank"
          rel="noreferrer"
          className="inline-flex items-center justify-center rounded-xl border border-white/10 bg-white/10 px-3 py-2 hover:bg-white/20 transition"
          aria-label="Open project"
          title="Open project"
        >
          <ExternalLink size={16} />
        </a>
        <button
          type="button"
          className="inline-flex items-center justify-center rounded-xl border border-white/10 bg-white/5 px-3 py-2 hover:bg-white/10 transition"
          title="More"
        >
          <MoreHorizontal size={16} />
        </button>
      </div>
    </motion.article>
  );
}
